column3:
{pageend:Mh...?}
{tag:0} partecipare
{pageend:alla Gara-show.}
Torna quando avrai almeno un Pokémon che
conosca una mossa valida per la Gara-show.

{pageend:Signore e signori, le votazioni sono concluse!}
Quale Pokémon si sarà aggiudicato il titolo
{pageend:di performance migliore...?}
Annunciamo i risultati!

Benvenut{tag:0}{pageend: all’Arena delle Virtù!}
Se vuoi, posso aiutarti a iscriverti alle Super
Gare-show!

Benvenut{tag:0}{pageend: all’Arena delle Virtù!}
Questo è il banco di accettazione delle
{pageend:Gare-show in Link.}
Grazie a questa funzione, tu e i tuoi amici
potrete prendere parte alla stessa Gara-show!

Nelle Super Gare-show, quattro concorrenti
{pageend:si esibiscono per un grande pubblico!}
L’obiettivo è di collaborare l’uno con l’altro
{pageend:e far sì che lo show abbia successo...}
Ma lo show è, allo stesso tempo, una gara
in cui vengono valutati tre elementi: personalità,
{pageend:danza e mosse!}
Esistono anche le prove, che permettono
ai concorrenti di prepararsi al meglio.

La Valutazione della personalità viene fatta
in base alle virtù dei Pokémon e ai bolli
{pageend:con cui la loro capsula è stata personalizzata!}
Ci sono cinque tipi di virtù: Classe, Bellezza,
{pageend:Grazia, Acume e Grinta...}
Un Pokémon può migliorare in ciascuna di esse
{pageend:mangiando dei poffin.}
La capsula, invece, può essere modificata
{pageend:dal menu principale o mediante il PC!}
Ricorda che i bolli apposti sulla capsula devono
essere adatti alla Gara a cui stai partecipando...
La chiave è sperimentare a più non posso!

La Valutazione della danza giudica la capacità
{pageend:di tenere il ritmo!}
Segui la musica e premi il pulsante a tempo
{pageend:con le note che scorrono da destra.}
A seconda della precisione con cui lo farai,
otterrai uno fra quattro possibili punteggi,
corrispondenti alle valutazioni "Troppo presto!" o
{pageend:"Troppo tardi!", "Bene!", "Ottimo!" e "Favoloso!".}
Migliore sarà il tempismo, più si riempirà
l’indicatore dei cuori...
Riempilo al massimo, e guadagnerai un <color=#F01E1EFF>♥</color>{pageend:!}
Guadagna tanti <color=#F01E1EFF>♥</color>, e la tua performance sarà
{pageend:davvero... favolosa!}
Così anche il giudizio finale salirà in alto...
{pageend:Anzi, schizzerà alle stelle!}
Inoltre, guadagnando molti <color=#F01E1EFF>♥</color> riempirai
l’indicatore dello show condiviso dai concorrenti,
{pageend:aumentando al massimo l’entusiasmo dell’arena!}
Se la Gara-show andrà a buon fine, guadagnerai
punti successo e man mano renderai il palco
dell’arena sempre più magnifico!

La Valutazione della danza giudica la capacità
{pageend:di tenere il ritmo!}
Segui la musica e premi il pulsante a tempo
{pageend:con le note che scorrono da destra.}
A seconda della precisione con cui lo farai,
otterrai uno fra quattro possibili punteggi,
corrispondenti alle valutazioni "Troppo presto!" o
{pageend:"Troppo tardi!", "Bene!", "Ottimo!" e "Stellare!".}
Migliore sarà il tempismo, più si riempirà
l’indicatore dei cuori...
Riempilo al massimo, e guadagnerai un <color=#F01E1EFF>♥</color>{pageend:!}
Guadagna tanti <color=#F01E1EFF>♥</color>, e la tua performance sarà
{pageend:davvero... stellare!}
Così anche il giudizio finale salirà in alto...
{pageend:Anzi, schizzerà alle stelle!}
Inoltre, guadagnando molti <color=#F01E1EFF>♥</color> riempirai
l’indicatore dello show condiviso dai concorrenti,
{pageend:aumentando al massimo l’entusiasmo dell’arena!}
Se la Gara-show andrà a buon fine, guadagnerai
punti successo e man mano renderai il palco
dell’arena sempre più magnifico!

La Valutazione della mossa prende in esame
la mossa Gara del Pokémon, che potrà essere
{pageend:usata una sola volta durante lo show...}
Le mosse Gara sono mosse che possono aiutare
{pageend:i concorrenti in svariati modi durante la danza!}
Imposta la mossa che preferisci al banco
{pageend:di accettazione e usala al momento giusto...}
Il pubblico valuterà l’esecuzione della mossa
e assegnerà dei <color=#F01E1EFF>♥</color>{pageend: in base al gradimento!}
Facendo seguire la mossa a quella degli altri
concorrenti, potrai creare delle combo...
E otterrai molti più <color=#F01E1EFF>♥</color>{pageend:!}
Inoltre, se il tipo delle mosse combacia
i <color=#F01E1EFF>♥</color>{pageend: ottenuti aumenteranno ulteriormente!}
E ricorda: il segreto è sferrare la mossa
al momento giusto!

Esistono quattro livelli diversi di Gare-show
{pageend:in link: Livello Normale, Mega, Ultra e Master.}
Più ci si avvicina al Livello Master e più aumenta
{pageend:la difficoltà.}
Nelle Gare in link puoi sperimentare da subito
tutti i livelli!

{pageend:Mh?}
A quanto pare nessuno dei tuoi Pokémon
{pageend:può partecipare a quella Gara.}
È riservata ai Pokémon che sfoggiano un Fiocco
Stella delle Gare. Torna quando ne avrai uno!

{pageend:Oh...}
Sembra che tu non abbia mai partecipato
{pageend:a una Gara-show di quel livello.}
Torna dopo aver vinto una Gara-show
del livello precedente.

Oh! A quanto pare non fai ancora parte
{pageend:di nessun gruppo!}
Riprova dopo essere entrat{tag:0} in un gruppo.

Sei stat{tag:0} premiat{tag:1} per la performance migliore
{pageend:in tutte le Gare-show!}
Per celebrare questo straordinario risultato,
voglio darti un {tag:2}{pageend:!}
Complimenti!

Per ora ci hai messo
{tag:0}{pageend:}
{pageend:turni.}
Pensi di avere un buon ritmo?

Sono passati
{tag:0}{pageend:}
{pageend:turni.}
Pensi ancora di farcela?

Ci hai battuto tutti e tre!
{pageend:Ci hai messo}
{tag:0}{pageend:}
turni in totale.

Oh, hey. Bel lavoro, ragazzino.
{pageend:Hai davvero rispettato i requisiti.}
Ma chi dice che dobbiamo mantenere le
{pageend:promesse!}
Ahahahaha...
